import React from "react";
import Jumbotron from "./components/jumbotron";
import jumboData from "./fixtures/jumbo.json";

function App() {
  return (
    <Jumbotron.container>
      {jumboData.map((item) => {
        <Jumbotron key={item.id} direction={item.direction}>
          <p>Hello</p>
        </Jumbotron>;
      })}
    </Jumbotron.container>
  );
}

export default App;
